import { useEffect } from 'react';
import './App.css';

function App() {

  const [powerOn, setOn] = useState(false);

  function onClick() {
    setOn(true);
    console.log("clicked");
  };

  return (
      <div className="Phone"style={{height: "500px"}}>
        <Side direction={powerOn ? "Front" : "Sideways"} onClick={onClick} />
        <Screen direction={powerOn ? "Front" : "Sideways"} />
      </div>
    );
  }

  export default App;
